import React from 'react';


function Menu(props) {
    return (
        <nav className="navbar navbar-expand-md bg-body py-3">
            <div className="container">
                <div id="navcol-2" className="collapse navbar-collapse"></div>
            </div>
        </nav>
    );
}

export default Menu;
